import React from 'react';
import { Jumbotron, Container, Form, FormGroup, Label, Input, Button } from 'reactstrap';
import Menu from '../components/Menu';
import { Component } from 'react';

class Contato extends Component {

    state = {
        nome: '',
        email: '',
        assuntoMsg: '',
        conteudoMsg: '',
        formSuccess: false,
        msg: ''
    }
    render() {
        return (
            <>
                <Menu />
                <Jumbotron fluid className="head-contato">
                    <style>{`.head-contato{
                            padding-top: 80px;
                            padding-bottom: 80px;
                            background-color: #000;
                            color: #fff;
                            margin-bottom: 0rem !important;
                    }`}</style>
                    <Container>
                        <h1 className="display-4 text-center">Contato</h1>
                    </Container>
                </Jumbotron>
                <Jumbotron fluid className="contato">
                    <style>{`.contato{
                            padding-top: 80px;
                            padding-bottom: 80px;
                            background-color: #fff;
                            margin-bottom: 0rem !important;
                    }`}</style>
                    <Container>
                        <Form>
                            <FormGroup>
                                <Label for="nome">Nome: </Label>
                                <Input type="text" name="nome" id="nome"
                                placeholder="Nome completo" />
                            </FormGroup>

                            <FormGroup>
                                <Label for="email">E-mail: </Label>
                                <Input type="email" name="email" id="email"
                                placeholder="Seu melhor e-mail" />
                            </FormGroup>

                            <FormGroup>
                                <Label for="assuntoMsg">Assunto: </Label>
                                <Input type="text" name="assuntoMsg" id="assuntoMsg"
                                placeholder="Assunto da mensagem" />
                            </FormGroup>

                            <FormGroup>
                                <Label for="conteudoMsg">Conteúdo: </Label>
                                <Input type="textarea" name="conteudoMsg" id="conteudoMsg"
                                placeholder="Conteúdo da mensagem" />
                            </FormGroup>

                            <Button type="submit" outline color="warning">Enviar</Button>
                        </Form>
                    </Container>
                </Jumbotron>
            </>
        )
    }
}


export default Contato;
